        /* add player`s 1st char to every cell with his unit, with specified color */
        function playerBanner() {
            function getColor(nick) {
                var c0 = nick.charCodeAt(0);
                var r = c0 * c0 % 255;
                var c1 = nick.charCodeAt(1);
                var g = c1 * c1 % 255;
                var c2 = nick.charCodeAt(2);
                var b = c2 * c2 % 255;
                return ['rgb(' + r + ',' + g + ',' + b + ')', 'rgb(' + (255 - r) + ',' + (255 - g) + ',' + (255 - b) + ')'];
            }
            $('#dmap td[background]').each(function(i, td) {
                var img = $(td).children('img');
                if ($(img).attr('tooltip')) {
                    var tooltip = $(img).attr('tooltip').split('<b>')[1];
                    if (tooltip) {
                        var nickname = tooltip.split('</b>')[0];
                        var span = document.createElement('span');
                        span.innerHTML = nickname.charAt(0);
//                        span.innerHTML = nickname.substr(0,3);
                        $(span).css('color', getColor(nickname)[0]);
                        $(span).css('background-color', getColor(nickname)[1]);
                        $(span).css('border-radius', '50px');
                        $(span).width(20);
                        $(span).css('position', 'absolute');
                        var position = $(td).position();
//                        console.log(position);
                        $(span).css('top', position.top + 10);
                        $(span).css('left', position.left + 10);
//                        $(span).css('top', '-30px');
//                        $(span).css('left', '-10px');
//                        $(td).css('position', 'absolute');
                        $(span).appendTo(td);
                    }
                }
            });
        }
        function safeNames() {
            if ($('.safe-name').length === 0 && window.g) {
                $("<style>.safe-name {position: relative; bottom: 5px; font-size: 10px; color: yellow; font-family: Arial;} </style>").appendTo("head");
                townId = "safe_" + window.g.mobjects[window.g.objcity + 5];
                safes = localStorage.getItem(townId);
                if (safes === null || safes === "") {
                    safes = "";
                    $("img[src='2618.gif']").each(function(i, safe) {
                        safes += "Сейф" + i + ",";
                    });
                    localStorage.setItem(townId, safes);
                }
                safesArray = safes.split(",");
                localStorage.setItem("safes", "");
                // dropdown menu give to
                var j = 0;
                $("select.mtext option").each(function(i, safe) {
                    if ($(safe).html() === "Сейф") {
                        $(safe).html(safesArray[j++]);
                    }
                });
                // take from
                $("img[src='2618.gif']").each(function(i, safe) {
                    var span = document.createElement('span');
                    $(span).html(safesArray[i]);
                    $(span).addClass('safe-name');
                    $(safe).parent().parent().append(span);
                    $(span).click(function() {
                        var name = prompt("Введите название сейфа", $(this).html());
                        if (name) {
                            $(this).html(name.substr(0, 8));
                            safesArray[i] = $(this).html();
                            localStorage.setItem(townId, safesArray.join());
                        }
                    });
                });
            }
        }
        function potionControl() {
            $('img[src="395.gif"], img[src="345.gif"], img[src="435.gif"], img[src="385.gif"]').each(function(i, potionIco) {
                function blink(potionIco, interval) {
                    setInterval(function(interval) {
                        $(potionIco).fadeOut(interval).fadeIn(interval);
                    }, interval * 2);
                }
                var times = $(potionIco).attr('tooltip').match(/(\d+):(\d+):(\d+)/);
                if (times) {
                    var h = times[1];
                    if (h < 3) {
                        blink(potionIco, 400);
                        $(potionIco).css('border', '2px dashed red');
                    } else if (h < 6) {
                        $(potionIco).css('border', '2px dashed red');
                    } else if (h < 12) {
                        $(potionIco).css('border', '1px dotted yellow');
                    }
                }
            });
        }
